method calling support automatic referencing and dereferencing -> implcitly induce from method receivers defined within the context of struct, enum or trait the first parameter is always self #[derive(Debug)]
struct Rectangle { width: u32, height: u32,
} impl Rectangle { // &self is shorthand of self: &Self fn area(&self) -> u32 { self.width * self.height }
} fn main() { let rect1 = Rectangle { width: 30, height: 50, }; // automatic referencing and de-referencing here: rect1.area() is same as (&rect1).area() println!("The area of the rectangle is {} square pixels.", rect1.area() );
